import React from "react";
import ItemDetails,{Record} from "../ItemDetails";
import SwapiService from "../../services/SwapiService";

const swapiService = new SwapiService();

const {
  getPerson,
  getPlanet,
  getStarship,
  getPersonImage,
  getPlanetImage,
  getStarshipImage
} = swapiService;

const PersonDetails = ({ itemId }) => {

  return(

    <ItemDetails itemId={itemId} getData={getPerson} getImageUrl={getPersonImage}>
    <Record field="name" label="name" />
    <Record field="gender" label="gender" />
    <Record field="birthYear" label="birth year" />
    <Record field="eyeColor" label="eye color" />
  </ItemDetails>
    )
};
const PlanetDetails = ({ itemId }) => {
  return(

    <ItemDetails itemId={itemId} getData={getPlanet} getImageUrl={getPlanetImage}>
    <Record field="name" label="name" />
    <Record field="population" label="population" />
    <Record field="diameter" label="diameter" />
    <Record field="climate" label="climate" />
  </ItemDetails>
    )
};
const StarshipDetais = () => {};

export { PersonDetails, PlanetDetails, StarshipDetais };
